message:
JSON API version

/JV comamnd for JSON API version added. Payload: {"api_version": "major.minor"}
strncasecmp() replaced with strncmp_P()

Adjustments for new device mapping

New variables:
const int fixed_device_family = 0;
const int fixed_device_variant = 0;

Adjustments for new device mapping

New variables:
const int fixed_device_family = 0;
const int fixed_device_variant = 0;

save 98 bytes of RAM

Very interesting:
char sscanf_buf[24];
strcpy_P(sscanf_buf, PSTR("%u.%u.%u.%u"));
sscanf(buf, sscanf_buf, &i0, &i1, &i2, &i3);
is shorter than
sscanf_P(buf, PSTR("%u.%u.%u.%u"), &i0, &i1, &i2, &i3);

added files that should have been part of https://github.com/fredlcore/BSB-LAN/pull/567

from BSB_LAN_config.h.default:
// Should you prefer to use local copies instead, put the files from the data subdirectory onto your
// bsb-lan unit's SD card (*), [...]

Update BSB_lan.ino

Code cleanup: pushStrToBigBuff_*(); -> printToWebClient();
transmitFile() use bigBuff now instead dynamic allocation

